When I was 23-25 years old I lived on Seventh Ave and 14th street in NYC, looking south, east and west. This is south looking down Seventh Ave.  I could see all the way down to the old World Trade Center. I loved living here and this time in my life. A time when I just explored myself. I wish my job hadn’t cut all my hair off, but nothing could dim my light. I’ve always had a ferocious ability to survive, and to fight for my creativity. It’s the core of who I am. And I love being an artist. And I love working with other artists. It’s just the best, really. 

