“A Comedy of Errors” at Hudson Guild was a pretty fun time. Worked with Erik Jensen, who was and is a spectacular talent.  I remember working on one of Adriana’s monologues with Kristin Linklatter, who showed me how the most horrible personal pain can actually be hilariously funny.  It was built into Shakespeare’s writing and so there was no denying it. No way to be “outraged” or make it justifiable. The character was a raging, jealous woman and full of self pity. And when I filled it up with my own sorrow and tears, the class burst into hysterical laughter. As the years have gone by I have discovered that truth is what makes people really laugh. The recognition that something is true. So if you want to be funny, all you really have to do is be really, really honest. Not so hard, right? (Winky face goes here).

@ejensen123 @hudsonguild 

